import React from 'react';
import Skills from '../components/Skills';

/**
 * Skills Page Component
 * Dedicated page for technical expertise and skill showcase
 */
const SkillsPage = () => {
  return (
    <div className="page page--skills">
      <Skills />
    </div>
  );
};

export default SkillsPage;
